contract Counter {
    address public owner;
    int public count;

    constructor(int _number) {
        owner = msg.sender;
        count = _number;
    }

    function increese() public {
        count++;
    }
    function degreese() public {
        count--;
    }
    function value() public view returns(int){
        return count;
    }
}

